import styled from 'styled-components';
import CountDown from '../../Components/CountDown';


const DealsGrabContainer=styled.div`
text-align: center;
`;
const DealsWrapper=styled.div`
 padding-top: 20px;
 padding-bottom: 20px;
`;

const Connecter=styled.div`
 padding-top: 20px;
 background-color: whitesmoke;
`;

const Row=styled.div`
width: 100%;
margin: 20px auto;
background-color: whitesmoke;
`;

const Sd1=styled.div`
height: 806px;
position: relative;
background-color: whitesmoke;

&::before{
    position: absolute;
    content: '';
    width: 100%;
    height: 100%;
    top: 0;
    left: 50%;
    background-color: #FEDE17;
    transform: skewX(25deg);
    z-index: 0;
}
`;


const Deals = () => {
    return (
        <DealsGrabContainer>
            <Connecter/>
            <DealsWrapper>
            <h1>
             Grab your Deals Now
            </h1>
            </DealsWrapper>
            <Row>
                <Sd1>
                   {/* <CountDown> */}
                        <h1 style={{color:'black'}}>
                            kl
                        </h1>
                   {/* // </CountDown> */}
                </Sd1>
            </Row>
      </DealsGrabContainer>
    )
}

export default Deals
